      pitch_variance = 0,
      sound_length = 0.00,
   },
   [30577] = { -- 16807793
      text = 'A holy symbol is the physical focus for the manifestation of a god\'s will.',
      sound_resref = '',
      vol_variance = 0,
      pitch_variance = 0,
      sound_length = 0.00,
   },
   [30578] = { -- 16807794
      text = 'A lantern is an enclosed flame - making it more resistant to windy conditions than a torch or candle.',
      sound_resref = '',
      vol_variance = 0,
      pitch_variance = 0,
      sound_length = 0.00,
   },
   [30579] = { -- 16807795
      text = 'A short length of wood with a handle attached to the side, the tonfa is typically wielded in pairs and is used both defensively and offensively.',
      sound_resref = '',
      vol_variance = 0,
      pitch_variance = 0,
      sound_length = 0.00,
   },
   [30580] = { -- 16807796
      text = 'A simple outfit, of the type a monk at a monastery might wear.',
      sound_resref = '',
      vol_variance = 0,
      pitch_variance = 0,
      sound_length = 0.00,
   },
   [30581] = { -- 16807797
      text = 'A small Netherese bauble somehow found its way into the pocket of a halfling named Torias, who, thinking it might make a stylish addition to his dagger\'s hilt, left it and his tiny blade in the care of a Bedine smith. Completing his work and retiring for the evening, the smith the next morning found the bauble gone and the humble blade transformed into a magnificent sword that Torias, unfortunately, could not ever hope to wield.',
      sound_resref = '',
      vol_variance = 0,
      pitch_variance = 0,
      sound_length = 0.00,
   },
   [30582] = { -- 16807798
      text = 'A sticky yellow substance coats the head of the missile. It is said missiles such as these sap the strength from the muscles of those struck by it.',
      sound_resref = '',
      vol_variance = 0,
      pitch_variance = 0,
      sound_length = 0.00,
   },
   [30583] = { -- 16807799
      text = 'A sticky, tarry substance coats the tip of this spear. The poison is said to come from the prickly spines of a sea urchin found in southern waters.',
      sound_resref = '',
      vol_variance = 0,
      pitch_variance = 0,
      sound_length = 0.00,
   },
   [30584] = { -- 16807800
      text = 'A suit of armor strangely reminiscent of a controversial lady\'s…',
      sound_resref = '',
      vol_variance = 0,
      pitch_variance = 0,
      sound_length = 0.00,
   },
   [30585] = { -- 16807801
      text = 'Also known as a butterfly sword, these weapons are traditionally wielded in pairs. The blade length of the weapon is equal to the fist and the forearm, allowing them to be rotated inside the forearms.',
      sound_resref = '',
      vol_variance = 0,
      pitch_variance = 0,
      sound_length = 0.00,
   },
   [30586] = { -- 16807802
      text = 'An exotic costume from an equally exotic land.',
      sound_resref = '',
      vol_variance = 0,
      pitch_variance = 0,
      sound_length = 0.00,
   },
   [30587] = { -- 16807803
      text = 'An imposing suit of armor, with special accommodations made for its owner\'s unique anatomy. ',
      sound_resref = '',
      vol_variance = 0,
      pitch_variance = 0,
      sound_length = 0.00,
   },
   [30588] = { -- 16807804
      text = 'Armand, a well known tiefling from the outer realms, was known to make his point fervently and successfully with this rapier many times over.',
      sound_resref = '',
      vol_variance = 0,
      pitch_variance = 0,
      sound_length = 0.00,
   },
   [30589] = { -- 16807805
      text = 'As beautiful - and deadly - as their wielders, the sword of an Erinyes is a dangerous weapon.',
      sound_resref = '',
      vol_variance = 0,
      pitch_variance = 0,
      sound_length = 0.00,
   },
   [30590] = { -- 16807806
      text = 'Because what fantasy RPG would be complete without one, if only to uphold stereotypes and running jokes...',
      sound_resref = '',
      vol_variance = 0,
      pitch_variance = 0,
      sound_length = 0.00,
   },
   [30591] = { -- 16807807
      text = 'Blades of this type were blessed by wandering clerics of The Morning Lord in an effort to spread the faith to the peoples of the vast eastern desert.',
      sound_resref = '',
      vol_variance = 0,
      pitch_variance = 0,
      sound_length = 0.00,
   },
   [30592] = { -- 16807808
      text = 'Clothing of this sort is made for assorted partially or fully fiendish plane-touched. As their anatomy is often more than slightly out of the norm, they tend to require special consideration in their wardrobe....',
      sound_resref = '',
      vol_variance = 0,
      pitch_variance = 0,
      sound_length = 0.00,
   },
   [30593] = { -- 16807809
      text = 'Cruel Sahuagin tridents are tipped with poison, making even a glancing blow deadly. A simple dweomer protects the haft and poison from dissolving in the water\'s depths.',
      sound_resref = '',
      vol_variance = 0,
      pitch_variance = 0,
      sound_length = 0.00,
   },
   [30594] = { -- 16807810
      text = 'Dark times call for strong measures and the creator of this ring knew the old adage as well as many. There are a few examples of this type of item still to be found in the realms, said to be proof against the enroachments of the undead.',
      sound_resref = '',
      vol_variance = 0,
      pitch_variance = 0,
      sound_length = 0.00,
   },
   [30595] = { -- 16807811
      text = 'Fashion accessories make great weapons-of-convenience. Babies don\'t though.',
      sound_resref = '',
      vol_variance = 0,
      pitch_variance = 0,
      sound_length = 0.00,
   },
   [30596] = { -- 16807812
      text = 'Fine in cut and questionable in practicality, this outfit would set the heart of any dandy alight.',
      sound_resref = '',
      vol_variance = 0,
      pitch_variance = 0,
      sound_length = 0.00,
   },
   [30597] = { -- 16807813
      text = 'Flag standards are often used on the battlefield as a rallying point for soldiers.',
      sound_resref = '',
      vol_variance = 0,
      pitch_variance = 0,
      sound_length = 0.00,
   },
   [30598] = { -- 16807814
      text = 'Grunwald was a half-orc miner, leader of the Shiaz rebellion. Legend has it that in his digging, Grunwald\'s crew once unearthed a demon from its millenia of imprisonment and were forced to fight for their very lives. This is the fabled pick which he wielded that day and which bathed in its ichor.',
      sound_resref = '',
      vol_variance = 0,
      pitch_variance = 0,
      sound_length = 0.00,
   },
   [30599] = { -- 16807815
      text = 'Made of rich silks and soft fabrics, several layers of cloth make up this elegant and exotic garment.',
      sound_resref = '',
      vol_variance = 0,
      pitch_variance = 0,
      sound_length = 0.00,
   },
   [30600] = { -- 16807816
      text = 'Odachi literally translates as big thick sword. Often mistaken for Nodachi which translates as field sword. These are two-handed swords, used in place of the traditional katana and wakizashi of some warriors, but forged in a similar style.',
      sound_resref = '',
      vol_variance = 0,
      pitch_variance = 0,
      sound_length = 0.00,
   },
   [30601] = { -- 16807817
      text = 'Officious and impressive robes, sure to help a magus of any stripe claim the respect they deserve.',
      sound_resref = '',
      vol_variance = 0,
      pitch_variance = 0,
      sound_length = 0.00,
   },
   [30602] = { -- 16807818
      text = 'One of the long-handled sabers, the Pu Dao (Dashing Saber) has a short rod and longer saber blade. Commonly, the Pu Dao was used for ground-vs.-horseback attacks, but can also be an effective ground-to-ground weapon.',
      sound_resref = '',
      vol_variance = 0,
      pitch_variance = 0,
      sound_length = 0.00,
   },
   [30603] = { -- 16807819
      text = 'Pan pipes are an early wind instrument.',
      sound_resref = '',
      vol_variance = 0,
      pitch_variance = 0,
      sound_length = 0.00,
   },
   [30604] = { -- 16807820
      text = 'Plain of construction, jagged and broken edges, nothing about the appearance of this axe gives away the vampiric, blood feeding nature of it. These weapons are the bane of good everywhere.',
      sound_resref = '',
      vol_variance = 0,
      pitch_variance = 0,
      sound_length = 0.00,
   },
   [30605] = { -- 16807821
      text = 'Planetars wield powerful weapons of otherworldly enchantment.',
      sound_resref = '',
      vol_variance = 0,
      pitch_variance = 0,
      sound_length = 0.00,
   },
   [30606] = { -- 16807822
      text = 'Renwald the Grey, a bard of some repute in the Northern Reaches, was known as much for his forked tongue as he was for his ability to escape the long arm of kings and wizards who bore the brunt of his barbs.',
      sound_resref = '',
      vol_variance = 0,
      pitch_variance = 0,
      sound_length = 0.00,
   },
   [30607] = { -- 16807823
      text = 'Sad indeed is the lot of those who find themselves thus garbed, for often their future is naught more than endless hours of back-breaking labor under the tender ministrations of the lash..',
      sound_resref = '',
      vol_variance = 0,
      pitch_variance = 0,
      sound_length = 0.00,
   },
   [30608] = { -- 16807824
      text = 'Simple garments, well suited to simple folk.',
      sound_resref = '',
      vol_variance = 0,
      pitch_variance = 0,
      sound_length = 0.00,
   },
   [30609] = { -- 16807825
      text = 'Some picks, like this one, come from the deepest bowels of the earth where the deep gnomes dwell. They confer upon the user the ability to see in the dark and a resistance to spells found naturally in their maker\'s warrens.',
      sound_resref = '',
      vol_variance = 0,
      pitch_variance = 0,
      sound_length = 0.00,
   },
   [30610] = { -- 16807826
      text = 'Some say that these swords, forged in blood and pain and misery, are the physical manifestation of minor demons on this plane of existence. Of course, some say that about tax collectors, too. That doesn\'t make it true. ',
      sound_resref = '',
      vol_variance = 0,
      pitch_variance = 0,
      sound_length = 0.00,
   },
   [30611] = { -- 16807827
      text = 'Strung with horse hair, the bow is essential to bringing the tones of a violin to life.',
      sound_resref = '',
      vol_variance = 0,
      pitch_variance = 0,
      sound_length = 0.00,
   },
   [30612] = { -- 16807828
      text = 'Thayvian Circlets were created by the Red Wizards to help them fend off the aggressive Luskan Brotherhood. Though designed only to augment spellcasting abilities, they have the additional benefit of improving the wearer\'s hardiness, reflexes, and willpower. Since their introduction, the conflict between the two groups has been markedly restrained.',
      sound_resref = '',
      vol_variance = 0,
      pitch_variance = 0,
      sound_length = 0.00,
   },
   [30613] = { -- 16807829
      text = 'The bokken is a wooden practice sword shaped like a katana. Don\'t let the phrase practice sword fool you though as these weapons are dangerous in the hands of a master swordsman.',
      sound_resref = '',
      vol_variance = 0,
      pitch_variance = 0,
      sound_length = 0.00,
   },
   [30614] = { -- 16807830
      text = 'The chakram is a bladed hoop, thrown with a spinning motion.',
      sound_resref = '',
      vol_variance = 0,
      pitch_variance = 0,
      sound_length = 0.00,
   },
   [30615] = { -- 16807831
      text = 'The daikyu is a japanese longbow. The grip on this bow is actually placed 2/3 of the way down the shaft, making them useable from horseback or on the ground with ease in spite of their length.',
      sound_resref = '',
      vol_variance = 0,
      pitch_variance = 0,
      sound_length = 0.00,
   },
   [30616] = { -- 16807832
      text = 'The harp is a traditional stringed instrument.',
      sound_resref = '',
      vol_variance = 0,
      pitch_variance = 0,
      sound_length = 0.00,
   },
   [30617] = { -- 16807833
      text = 'The jitte is primarily a defensive weapon. It is a tapered iron bar with a short hook projecting near the Handle. It is not sharp. The jitte is used to block attacks and catch weapons. It can also be used to strike blows.',
      sound_resref = '',
      vol_variance = 0,
      pitch_variance = 0,
      sound_length = 0.00,
   },
   [30618] = { -- 16807834
      text = 'The KwanDao, or long-handled sword, is an intimidating weapon. In ancient times it was the weapon of choice for generals. Because of this association and its magnificence, it was called the general of the hundred weapons.',
      sound_resref = '',
      vol_variance = 0,
      pitch_variance = 0,
      sound_length = 0.00,
   },
   [30619] = { -- 16807835
      text = 'The legend goes that weapons such as these were crafted from the emerald greenery of Silvanus\' own grove, that those that seek to keep the wild places safe might do so convincingly. Some doubt that this is factual, but the honed edges of the swords do grow sharper and greener if watered and left in sunlight.',
      sound_resref = '',
      vol_variance = 0,
      pitch_variance = 0,
      sound_length = 0.00,
   },
   [30620] = { -- 16807836
      text = 'The lute is the traditional stringed instrument of a bard.',
      sound_resref = '',
      vol_variance = 0,
      pitch_variance = 0,
      sound_length = 0.00,
   },
   [30621] = { -- 16807837
      text = 'The most popular of the Spade (Chan) weapons is the Crescent Moon, these were primarily monk\'s weapons. The crescent moon is used to hook an enemy\'s weapon, while the head of the shovel is used to attack the head or foot of the enemy.',
      sound_resref = '',
      vol_variance = 0,
      pitch_variance = 0,
      sound_length = 0.00,
   },
   [30622] = { -- 16807838
      text = 'The Naginata is a Japanese polearm, in use at least from the 7th century onward. This weapon first saw use against mounted opponents where its long reach and sharp blade proved overwhelmingly effective. It is often wielded by monks and warrior priests. It is used with flowing, circular movements.',
      sound_resref = '',
      vol_variance = 0,
      pitch_variance = 0,
      sound_length = 0.00,
   },
   [30623] = { -- 16807839
      text = 'The straight sword is know as the weapon of a thousand days . This was the amount of time required to become proficient in the use of the straight sword.',
      sound_resref = '',
      vol_variance = 0,
      pitch_variance = 0,
      sound_length = 0.00,
   },
   [30624] = { -- 16807840
      text = 'The tanto is a japanese dagger, similar in style to its better known cousins the katana and wakizashi.',
      sound_resref = '',
      vol_variance = 0,
      pitch_variance = 0,
      sound_length = 0.00,
   },
   [30625] = { -- 16807841
      text = 'The Tetsubo is a long wooden rod, wielded with two hands, the upper half of which is covered with studded iron strips. Priests and wanderers often use it, since it can also serve as a walking stick.',
      sound_resref = '',
      vol_variance = 0,
      pitch_variance = 0,
      sound_length = 0.00,
   },
   [30626] = { -- 16807842
      text = 'The wakizashi is the shorter of the two swords in a daisho (the other being the katana). Some master swordsmen are said to be able to wield the two at the same time, creating a whirlwind of steel and death.',
      sound_resref = '',
      vol_variance = 0,
      pitch_variance = 0,
      sound_length = 0.00,
   },
   [30627] = { -- 16807843
      text = 'The yari is a japanese spear (or lance), used for stabbing. It is not weighted properly for throwing.',
      sound_resref = '',
      vol_variance = 0,
      pitch_variance = 0,
      sound_length = 0.00,
   },
   [30628] = { -- 16807844
      text = 'These capriciously named weapons are blessed by Eilistraee. Though few outside her faithful are likely to have trust in her good graces, these weapons have always proved their worth on the field of battle.',
      sound_resref = '',
      vol_variance = 0,
      pitch_variance = 0,
      sound_length = 0.00,
   },
   [30629] = { -- 16807845
      text = 'These small leather pouches are often used by merchants to store small gems.',
      sound_resref = '',
      vol_variance = 0,
      pitch_variance = 0,
      sound_length = 0.00,
   },
   [30630] = { -- 16807846
      text = 'This brightly colored garment seems designed to awe and intimidate.',
      sound_resref = '',
      vol_variance = 0,
      pitch_variance = 0,
      sound_length = 0.00,
   },
   [30631] = { -- 16807847
      text = 'This dark hood is highly obscuring, cloaking the wearer\'s face in shadow.',
      sound_resref = '',
      vol_variance = 0,
      pitch_variance = 0,
      sound_length = 0.00,
   },
   [30632] = { -- 16807848
      text = 'This falchion has been enchanted to both sear and slash adversaries with its poison-laced edge. It bears no maker\'s mark.',
      sound_resref = '',
      vol_variance = 0,
