      sound_length = 0.00,
   },
   [30633] = { -- 16807849
      text = 'This finely-wrought suit of full plate and embroidered surcoat look as if they would cost a fortune to have made, putting it strictly in the realm of noble warriors.',
      sound_resref = '',
