      text = 'This, the chosen weapon of Astral Devas, can be used to great effect, particularly against the undead.',
      sound_resref = '',
      vol_variance = 0,
      pitch_variance = 0,
      sound_length = 0.00,
   },
   [30661] = { -- 16807877
      text = 'Tierney Fsstaff was a traveler who prided herself on her feet never retracing her steps, as she strove to find new vistas over every next horizon. It was on these travels, and because of them, that she became quite capable of defending herself and her traveling companions. The original Blade Dervish was a blade such as this, crafted and imbued with magics to her liking by one such very grateful draconic companion.',
      sound_resref = '',
      vol_variance = 0,
      pitch_variance = 0,
      sound_length = 0.00,
   },
   [30662] = { -- 16807878
      text = 'Unsure of what it does, just holding this ring seems to make the shadows recede a little and the darkness of the night abate.',
      sound_resref = '',
      vol_variance = 0,
      pitch_variance = 0,
      sound_length = 0.00,
   },
   [30663] = { -- 16807879
      text = 'Weapons of this sort serve mainly as fashion accessories for vain and presumptuous spellcasters, but nonetheless have saved the skin of many a mage in times of trouble.',
