      vol_variance = 0,
      pitch_variance = 0,
      sound_length = 0.00,
   },
   [30664] = { -- 16807880
      text = 'When the half-orc Dirgan finished his crusade against the Necromancers of Fazir, it is said that this shield was fashioned from the skulls of his victims.',
      sound_resref = '',
      vol_variance = 0,
      pitch_variance = 0,
      sound_length = 0.00,
   },
   [30665] = { -- 16807881
      text = 'When the pit fiend Azavistos was slain and reduced to lermure status by a pair of devas on the Prime Material Plane, his evil mace Malefactor -- crafted from green Baatorian steel -- was brought to the aasimon citadel of Xal Brivala on Ysgard, and there it remained for one hundred years. This mace cannot be anything but an inspired copy, or can it?',
      sound_resref = '',
      vol_variance = 0,
      pitch_variance = 0,
      sound_length = 0.00,
   },
   [30666] = { -- 16807882
      text = 'When the wizard Sacateca took on the corrupted mages within his guild, this staff\'s protective abilities and offensive might helped keep him alive for the first three days of the conflict. Eventually, though, one too many lightning bolts slipped through his defenses.',
