      pitch_variance = 0,
      sound_length = 0.00,
   },
   [31473] = { -- 16808689
      text = 'Fierce hunters that roam the plains, wemics are masters of ambushes and strategy. Wemics have the body of a lion with a humanoid torso. A wemic\'s face is a mixture of human and leonine features. Wemics typically live and hunt in groups called prides.\n\nWemic Ability Adjustments: +7 Str, +1 Dex, +1 Con, -2 Cha\nFavored Class (Barbarian): A multiclass wemic\'s barbarian class does not count when determining whether he suffers an XP penalty for multiclassing.\nSpecial Abilities:\n- Alertness: Wemics cannot easily be surprised in combat\n- Skill Affinity (Hide): +2 Racial bonus to Hide checks\n- Skill Affinity (Jump): +11 Racial bonus to Jump checks\n- Skill Affinity (Listen): +8 Racial bonus to Listen checks\n- Skill Affinity (Move Silently): +6 Racial bonus to Move Silently checks\n- Skill Affinity (Spot): +8 Racial bonus to Spot checks\n- Skill Affinity (Wilderness Lore): +4 Racial bonus to Wilderness Lore checks',
      sound_resref = '',
      vol_variance = 0,
      pitch_variance = 0,
      sound_length = 0.00,
   },
   [31474] = { -- 16808690
      text = 'The wild, empty savannah is not enough to satisfy your natural curiosity about the world for any length of time. Forsaking your own pride, at least for the time being, your wanderings have brought you in contact with the puny Two-Legs who leap so boldly into the face of adventure.',
      sound_resref = '',
      vol_variance = 0,
      pitch_variance = 0,
      sound_length = 0.00,
   },
   [31475] = { -- 16808691
      text = 'Drider',
      sound_resref = '',
      vol_variance = 0,
      pitch_variance = 0,
      sound_length = 0.00,
   },
   [31476] = { -- 16808692
      text = 'Driders',
      sound_resref = '',
      vol_variance = 0,
      pitch_variance = 0,
      sound_length = 0.00,
   },
   [31477] = { -- 16808693
      text = 'drider',
      sound_resref = '',
      vol_variance = 0,
      pitch_variance = 0,
      sound_length = 0.00,
   },
   [31478] = { -- 16808694
      text = 'Driders are bloodthirsty creatures that lurk in the depths of the earth, seeking warm-blooded prey of any kind. These strange beings have the head and torso of a drow elf and the legs and lower body of a giant spider. Failed of Lolth, driders are outcast from their own communities. Drow and driders hate one another passionately.\n\nDrider Ability Adjustments: +3 Str, +3 Dex, +4 Con, +3 Int, +4 Wis, +4 Cha\nFavored Class (Cleric): A multiclass drider\'s cleric class does not count when determining whether he or she suffers an XP penalty for multiclassing.\nSpecial Abilities:\n- Ambidexterity, Combat Casting, Two-Weapon Fighting\n- Skill Affinity (Hide): +4 Racial bonus to Hide checks\n- Skill Affinity (Move Silently): +4 Racial bonus to Move Silently checks\n- Poison bite, Fortitude save (DC 16), initial and secondary damage 1d6 temporary strength\n- Spell-like abilitys: dancing lights, darkness, detect chaos, detect evil, detect good, detect law, detect magic, faerie fire, levitate, clairaudience/clairvoyance, discern lies, dispel magic, suggestion',
      sound_resref = '',
      vol_variance = 0,
      pitch_variance = 0,
      sound_length = 0.00,
   },
   [31479] = { -- 16808695
      text = 'Failed in the eyes of your goddess, shunned by cruel, violent people you once considered your own, the Underdark holds no comfort for you now. Driven from all you have known, only wanderlust and a thirst for adventure keeps you going now.',
      sound_resref = '',
      vol_variance = 0,
      pitch_variance = 0,
      sound_length = 0.00,
   },
   [31480] = { -- 16808696
      text = 'Plant',
      sound_resref = '',
      vol_variance = 0,
      pitch_variance = 0,
      sound_length = 0.00,
   },
   [31481] = { -- 16808697
      text = 'Plants',
      sound_resref = '',
      vol_variance = 0,
      pitch_variance = 0,
      sound_length = 0.00,
   },
   [31482] = { -- 16808698
      text = 'plant',
      sound_resref = '',
      vol_variance = 0,
      pitch_variance = 0,
      sound_length = 0.00,
   },
   [31483] = { -- 16808699
      text = 'Not all plants are motionless, drawn only by the wind, sun and water on life\'s canvas. Some have a mind and volition of their own.',
      sound_resref = '',
      vol_variance = 0,
      pitch_variance = 0,
      sound_length = 0.00,
   },
   [31484] = { -- 16808700
      text = 'Not too many plants are found wandering about looking for adventure. Something in your past has uprooted you though.',
      sound_resref = '',
      vol_variance = 0,
      pitch_variance = 0,
      sound_length = 0.00,
   },
   [31485] = { -- 16808701
