      sound_resref = '',
      vol_variance = 0,
      pitch_variance = 0,
      sound_length = 0.00,
   },
   [31488] = { -- 16808704
      text = 'Brownies are distant relatives of halflings (perhaps half halfing, half pixie) but they are smaller and far less common. They are basically friendly to huymans and their ilk but because they are shy, they are seldom seen and favour quiet, pastoral areas in which to dwell.\n\nBrownie Ability Adjustments: +7 Dex, +2 Con\nFavored Class (Wizard): A multiclass Brownie\'s wizard class does not count when determining whether he suffers an XP penalty for multiclassing.\nSpecial Abilities:\n- Alertness: Wemics cannot easily be surprised in combat\n- Skill Affinity (Hide): +2 Racial bonus to Hide checks\n- Skill Affinity (Listen): +8 Racial bonus to Listen checks\n- Skill Affinity (Move Silently): +6 Racial bonus to Move Silently checks\n- Skill Affinity (Spot): +8 Racial bonus to Spot checks',
      sound_resref = '',
      vol_variance = 0,
      pitch_variance = 0,
      sound_length = 0.00,
   },
   [31489] = { -- 16808705
      text = 'Pastoral dwelling places? Not for you. Your curiousity makes you an oddity among your own people as you yearn for adventure and a way to make a mark in a world much bigger than you are.',
