   [36573] = { -- 16813789
      text = 'The mouse is a manual drill, rotated by simple handles. This machine is usually used in conjunction with a gallery shed, since the whole thing is totally exposed. Realistically though, it stands little chance against a stone castle. Alas, you\'d stand a better chance carving a tunnel with a spoon. Still, If you have loads of spare time on your hands and an unprotected patch of wall, it\'s a cheap way to carve a hole in it.',
