      sound_length = 0.00,
   },
   [36574] = { -- 16813790
      text = 'The activation concept is simple, though there are many variations of these spring type engines. This particular design, known as the scorpion is characterized by the main launching, or striking, arm being bent back and held under tension. When the arm is released, it strikes and launches an arrow. This is a true direct-firing weapon in the sense that the fired projectile has a straight line trajectory. A crew of 4 is necessary for proper usage, giving a rate of fire of about one bolt every other minute. This particular engine is more anti-personnel than structure damaging.',
