   [36576] = { -- 16813792
      text = 'The \'arbalete a tour\' is basically a carriage or post mounted crossbow, scaled to fire a five foot shaft. The machine uses a wrench or winch to cock the firing mechanism and consisted of crews of two or more. They are often located in a siege tower. Another setting where this type of engine is common is marine warfare, where size is a limiting factor and a long shaft packs easier than round stones, not to mention the fact that rocks are not all that common on a boat.',
