   [36602] = { -- 16813818
      text = 'The most effective machine that a besieging force can have for direct assault is the high wood tower. Assembled on wheels, it can lower a kind of drawbridge to give passage for the attackers who then are able to charge directly the top of the defended ramparts. The belfries are often made from green sapling trees, cut in the forests close to the besieged places, which reduces their vulnerability to fire. Being of solid build, the structure can support considerable loads - carrying a payload of 50 fighters is not unheard of.',
      sound_resref = '',
      vol_variance = 0,
      pitch_variance = 0,
      sound_length = 0.00,
   },
   [36603] = { -- 16813819
      text = 'The most versatile attacker on the board, the knight has a peculiar two and over movement style, and is the only piece (aside from the rook and king while castling) that can \'jump\' over other pieces. This gives the knight great maneuverability. The knight must move two squares either horizontally or vertically, and then one perpendicular to its original move.',
      sound_resref = '',
