      sound_length = 0.00,
   },
   [36605] = { -- 16813821
      text = 'The moveable siege ladder is one of a class of weapons used in offensive siege warfare. The siege ladder allows attacking soldiers to cross moats or other blockades around castle walls. The siege ladder also provides offensive armies with a method of gaining entrance to a castle without first knocking down the castle walls. This design has an extendable ladder, which can elevate. It is however not frequently used because of the difficulty involved in transporting the heavy and bulky vehicle over rough terrain.',
      sound_resref = '',
      vol_variance = 0,
      pitch_variance = 0,
      sound_length = 0.00,
   },
   [36606] = { -- 16813822
      text = 'The queen is the most powerful piece on the board, capable of unlimited movement in any direction. Despite this, the queen is as vulnerable as any other piece, and makes a prime target. Losing ones queen early can be crippling. The queen can move and capture in any direction.',
