   [36661] = { -- 16813877
      text = 'This is a counterweight trebuchet, where the long pivoted beam, has the short side pulled down by the weight of a hutch filled with grovel. This in turn, causing the long side to rise quickly. A sling attached to the end of the long side of the beam whips over, releases itself and hurls the projectile it held. Though these machines have many variants, (often a result of on-location assembly) The counterweight type all share the same basic outlay. This particular design requires about 4 individuals to operate and can hurl, 80Kg stones for a distance of about 100 meters. reload time in this machine is relatively slow, requiring several minutes to fire again.',
      sound_resref = '',
      vol_variance = 0,
      pitch_variance = 0,
      sound_length = 0.00,
   },
   [36662] = { -- 16813878
      text = 'This is a counterweight trebuchet, where the long pivoted beam, has the short side pulled down by the weight of a two hutches filled with gravel. This in turn, causing the long side to rise quickly. A sling attached to the end of the long side of the beam whips over, releases itself and hurls the projectile it held. The two smaller hutches permit easier transport and assembly, also giving excellent horizontal accuracy due to their superior balance. This particular design requires about 4 individuals to operate and can hurl, 80Kg stones for a distance of about 150 meters. It\'s rate of fire is five to six times higher than that of the  regular single hutch Trebuchet. In the world of counterweight trebuchets, this one can be considered as top dog.',
      sound_resref = '',
      vol_variance = 0,
