   [36671] = { -- 16813887
      text = 'This is a single arm, torsion-powered, stone-throwing engine. This machine has its throwing arm\'s lower end inserted into twisted sinew and is held in torsion. And the upper throwing end of the arm is installed with a sling, to add the angular momentum of the pouch to the forward thrust of the projectile. The rate of fire is about one shot per minute and a weight of 15Kg can be flung to a distance of 180 Meters with a crew of two.',
