   },
   [36674] = { -- 16813890
      text = 'This is a traction trebuchet, or Perrier (rock thrower). The power is provided by muscle. The triangular spreader is used to facilitate several pulling ropes. This particular design has the triangle in a horizontal arrangement. The advantages of this design is that all the pullers\' ropes are joined to the beam at the same height, so they all reach their maximum leverage and pull at the same moment of the launch -  giving a potential for a more explosive effort. The triangle also supports the axle, making it easier to build the axle assembly rigid. Movement here can have a large effect on the side-to-side accuracy of the machine. The major disadvantages are that the pullers all reach the point where their efforts have no effect (when their ropes are in line with the beam) at the same time, after which the beam is coasting. The engine has very fast reload time. With a crew of 3, This  particular machine can shoot several times a minute, projectiles of about 10Kg to a distance of about 50 meters. Also since this type has a single upright beam and is very small, construction is very fast and very easy.',
      sound_resref = '',
      vol_variance = 0,
      pitch_variance = 0,
      sound_length = 0.00,
   },
   [36675] = { -- 16813891
      text = 'This is a traction trebuchet, the power is mainly provided by muscle. The triangular spreader is used to facilitate several pulling ropes. This particular design has the triangle in a vertical arrangement and has an additional weight at the base of the triangle. Such hybrid machines, using both counterweights and manual pulling power are also called Bricole. The advantages of the vertical formation is that The pullers each reach their maximum and minimum efforts at slightly different times thus giving a more even and longer application of power. This allows the machine to throw heavier projectiles. The major disadvantage is that the pullers\' maximum efforts and leverage cannot occur at the same time, losing   the explosive team burst of power. The engine has very fast reload time. With a crew of 8, This  particular machine can shoot several times a minute, projectiles of about 25Kg to a distance of about 200 meters.',
      sound_resref = '',
      vol_variance = 0,
      pitch_variance = 0,
      sound_length = 0.00,
