      text = 'This machine of war is assembled on a mobile mounting which makes it possible to point the mechanism towards the objective with much precision. One then lays a long spear, several meters in length on the axis. The winch hastens reload time, and the added torsion of the ropes can hurl a projectile to more than 60 meters. This frightening machine is especially used against other machines of war.',
