      text = 'This mobile catapult design uses a bow to provide the stored tension needed for the firing mechanism. It is relatively easy to operate, and can deliver 15kg stone projectiles to a distance of about 250 meters with deadly precision. A crew of 3 is more than enough to provide a respectable firing rate of about 1 shot per minute.',
