   [36686] = { -- 16813902
      text = 'This mobile ram consists of a long beam armed with an iron head at its end, suspended horizontally with cables or chains, and driven by means of cords fixed at the tail. The crew operating the arm is sheltered under a roof, which facilitates closer proximity to the besieged structure. The belier is mostly used to attack walls, though a gate would make an easier target.',
