   [36701] = { -- 16813917
      text = 'This shabby looking outhouse is actually an entrance to a mine. A mine is used to damage walls. A tunnel is dug below the foundations of the castle wall. A large chamber is created underneath the foundations by excavating the soil; the wall above being temporarily supported by wooden props. Between these props the miners place combustible material. Once the chamber is deemed to be sufficiently large, the combustible material is set on fire and the miners withdraw. The supporting props eventually burn through and the wall collapses into the chamber. Once a mine is begun, the only defense against it is ounter-mining; i.e. the defenders dig their own tunnel hoping to break in to that of the besiegers and halt its construction or try to flood it. Of course, a good moat can prevent mining altogether.',
