   [36710] = { -- 16813926
      text = 'This siege engine is a hybrid trebuchet, requiring both a counterweight and traction for activation. The mangonneau is an enormous machine which requires the presence of 12 artillerists and  a chief of operation. The lever is lowered using a winch operated  by two wheels, six people are necessary because the counterweight  weighs several tons. When the lever is lowered the pocket of the  sling can be armed with a large stone ball or even several stones. The chief of operation gives the signal, the lever is released and  a group of gunners are suspended on the cords and accelerate the  upswing of the sling. The aiming process is rather long and one  must often carry out many tests. This machine can launch a heavy  projectile of about 100Kg only every approximately two hours, but  as soon as the calibration is finished the damage caused to fortifications is considerable. The projectile can reach a distance  of up to 150 meters. The Rather complicated nature of the reloading mechanism and the  enormous counterweight, produce a great deal of stress on the  frame, this in turn, massively reduces the life span of the mechanism.',
