   },
   [39314] = { -- 16816530
      text = 'A quite remarkable invention, the mechanized spider is used as a guard.',
      sound_resref = '',
      vol_variance = 0,
      pitch_variance = 0,
      sound_length = 0.00,
   },
   [39315] = { -- 16816531
      text = 'A strange beast with a wide pebbly, stone-like body and three long arms tipped with sharp talons. Between these arms sit large stone-lidded eyes peering in all directions. Strangest of all are the three legs and am ample sized mouth resting on top of its head.',
      sound_resref = '',
      vol_variance = 0,
      pitch_variance = 0,
      sound_length = 0.00,
   },
   [39316] = { -- 16816532
      text = 'A tiefling is a humanoid with Fiendish blood in them. This gives them traits that mark them as different, shunned by many and generally mistrusted - with good reason for many Tieflings are twisted and devious.',
      sound_resref = '',
      vol_variance = 0,
      pitch_variance = 0,
      sound_length = 0.00,
   },
   [39317] = { -- 16816533
      text = 'A tree-like creature whose leafless branches interlock to create a sinister, humanoid shape.',
      sound_resref = '',
      vol_variance = 0,
      pitch_variance = 0,
      sound_length = 0.00,
   },
   [39318] = { -- 16816534
      text = 'A visage is a strong undead spirit. They share a hatred of all living things and attack them on sight, perhaps because they remind them of what they once where. They seem to be unable to cause physical damage, this however does not stop them and their claws have other ways of hurting the prey. A greater Visage is stronger and with other abilities.',
      sound_resref = '',
      vol_variance = 0,
      pitch_variance = 0,
      sound_length = 0.00,
   },
   [39319] = { -- 16816535
      text = 'A visage is a strong undead spirit. They share a hatred of all living things and attack them on sight, perhaps becouse they remind them of what they once where. They seem to be unable to cause physical damage, this however does not stop them and their claws have other ways of hurting the prey.',
      sound_resref = '',
      vol_variance = 0,
      pitch_variance = 0,
      sound_length = 0.00,
   },
   [39320] = { -- 16816536
      text = 'Actually not a medusa but, rather, the result of a experiment by mages. It is an ordinary skeleton with the spirit of a medusa trapped inside its skull. This gives the skeleton additional strength and a terrible gaze attack - not to mention the small matter of a terrible hatred for everything living, a gift from the trapped soul.',
      sound_resref = '',
      vol_variance = 0,
      pitch_variance = 0,
      sound_length = 0.00,
   },
   [39321] = { -- 16816537
      text = 'Among the swiftest and most agile creatures in existence, they are often also mistaken for air elementals.',
      sound_resref = '',
      vol_variance = 0,
      pitch_variance = 0,
      sound_length = 0.00,
   },
   [39322] = { -- 16816538
      text = 'An abberation created by mages to use as a spy and familiar. The Flying Eye makes no sound at all, and when need be can use a few select spells. It usually avoids combat though, unless ordered to.',
      sound_resref = '',
      vol_variance = 0,
      pitch_variance = 0,
      sound_length = 0.00,
   },
   [39323] = { -- 16816539
      text = 'An Arctic Bugbear can be easily separated from their more common cousin with its height, larger ears and feet, smaller jaws, and, of course, white skin and fur. Do not judge a bugbear by the size of its jaws! The northern race of bugbears is even stronger than their southern counterparts.',
      sound_resref = '',
      vol_variance = 0,
      pitch_variance = 0,
      sound_length = 0.00,
   },
   [39324] = { -- 16816540
      text = 'An eagle is a magnificant bird, feeding on other birds and small rodents that it captures.',
      sound_resref = '',
      vol_variance = 0,
      pitch_variance = 0,
      sound_length = 0.00,
   },
   [39325] = { -- 16816541
      text = 'Animated objects are little less than ordinary objects like chairs and tables that can move around and do simple tasks that their creator orders them to.',
      sound_resref = '',
      vol_variance = 0,
      pitch_variance = 0,
      sound_length = 0.00,
   },
   [39326] = { -- 16816542
      text = 'Ash elementals are quite similar to Air elementals when it comes to power.',
      sound_resref = '',
      vol_variance = 0,
      pitch_variance = 0,
      sound_length = 0.00,
   },
   [39327] = { -- 16816543
      text = 'Azers are dwarves native to the elemental plane of fire.',
      sound_resref = '',
      vol_variance = 0,
      pitch_variance = 0,
      sound_length = 0.00,
   },
   [39328] = { -- 16816544
      text = 'Battle-worn clerics of Tyr are as good on the front lines as they are helping the wounded.',
      sound_resref = '',
      vol_variance = 0,
      pitch_variance = 0,
      sound_length = 0.00,
   },
   [39329] = { -- 16816545
      text = 'Believed to be a product of a magical experiment gone awry, these chaotic evil creatures are known to lair in caves and forests.',
      sound_resref = '',
      vol_variance = 0,
      pitch_variance = 0,
      sound_length = 0.00,
   },
   [39330] = { -- 16816546
      text = 'Belkers are composed primarily of smoke. Although undeniably evil, they are usually very reclusive and have no interest in the affairs of others.',
      sound_resref = '',
      vol_variance = 0,
      pitch_variance = 0,
      sound_length = 0.00,
   },
   [39331] = { -- 16816547
      text = 'Bladelings are xenophobic beings of humanoid shape. Thought they hail from Acheron, most scholars believe the race emigrated there from another plane.',
      sound_resref = '',
      vol_variance = 0,
      pitch_variance = 0,
      sound_length = 0.00,
   },
   [39332] = { -- 16816548
      text = 'Brownies are distant relatives of halflings (perhaps half halfing, half pixie) but they are smaller and far less common. They are basically friendly to humans and their ilk but because they are shy, they are seldom seen and favour quiet, pastoral areas in which to dwell.',
      sound_resref = '',
      vol_variance = 0,
      pitch_variance = 0,
      sound_length = 0.00,
   },
   [39333] = { -- 16816549
      text = 'Child of a humanoid and a fiendish parent, invariably half-fiends succumb to the blood and influence of the latter.',
      sound_resref = '',
      vol_variance = 0,
      pitch_variance = 0,
      sound_length = 0.00,
   },
   [39334] = { -- 16816550
      text = 'Coronated by the gods, kings can be both master and slave to their people.',
      sound_resref = '',
      vol_variance = 0,
      pitch_variance = 0,
      sound_length = 0.00,
   },
   [39335] = { -- 16816551
      text = 'Crustaceans such as the crab are highly sought after for their meat but the giant crab is too tough and stringy to make a great meal. Their size, plus powerful claws, also make them trickier prey than some might expect.',
      sound_resref = '',
      vol_variance = 0,
      pitch_variance = 0,
