      vol_variance = 0,
      pitch_variance = 0,
      sound_length = 0.00,
   },
   [39343] = { -- 16816559
      text = 'Fearless fighters, Cornugons are the elite shock troops of the Baatezu. Covered in hideous scales, these creatures can cut their foes to ribbons with their whips and their tails with equal ease - leaving their victims to bleed to death from infernal wounds.',
      sound_resref = '',
      vol_variance = 0,
      pitch_variance = 0,
      sound_length = 0.00,
   },
   [39344] = { -- 16816560
      text = 'Fierce hunters that roam the plains, Wemics are masters of ambushes and strategy. They have the body of a lion and the torso of a humanoid with a lion-like head.',
      sound_resref = '',
      vol_variance = 0,
      pitch_variance = 0,
      sound_length = 0.00,
   },
   [39345] = { -- 16816561
      text = 'Frost Goblins are a feared creature in cold areas. They are far superior to their southern relatives due to their strength and thick skin.',
      sound_resref = '',
      vol_variance = 0,
      pitch_variance = 0,
      sound_length = 0.00,
   },
   [39346] = { -- 16816562
      text = 'Fun-loving and capricious, pixes are winged fey of unpredictable dispositions.',
      sound_resref = '',
      vol_variance = 0,
      pitch_variance = 0,
      sound_length = 0.00,
   },
   [39347] = { -- 16816563
      text = 'Gelugons are the ferocious baatezu that live in frigid Caina. In terms of appearance, gelugons are the most alien of the baatezu. They have extremely large, insect like bodies towering a full 12 feet tail I They have great claws on their hands and feet and large, sharp pinchers at their mouth, Their heads bulge with great, multi-faceted eyes. As their most formidable weapon, gelugons have long, thick tails covered with razor-sharp spikes- They are indeed fearsome looking baatezu, commanding the respect of all their peers in the Nine Hells. Gelugons communicate telepathically.',
      sound_resref = '',
      vol_variance = 0,
      pitch_variance = 0,
      sound_length = 0.00,
   },
   [39348] = { -- 16816564
      text = 'Glabrezu are towering, broad and well muscled, with four arms, two ending in clawed hands and two in powerful pincers. They have doglike heads with sharp fangs and penetrating violet eyes.',
      sound_resref = '',
      vol_variance = 0,
      pitch_variance = 0,
      sound_length = 0.00,
   },
   [39349] = { -- 16816565
      text = 'House and alley cats are common in populated areas, prized for their abilities to keep the rodent populations in check; that is, when they are not being persecuted as the familiar of a local witch.',
      sound_resref = '',
      vol_variance = 0,
      pitch_variance = 0,
      sound_length = 0.00,
   },
   [39350] = { -- 16816566
      text = 'Huge and able to move as silently as a ghost, the white tiger is the source of many a supernatural tale.',
