      pitch_variance = 0,
      sound_length = 0.00,
   },
   [39368] = { -- 16816584
      text = 'Pigs are domisticated boars and the two species can be interbred. Domestic pigs have larger ears and shorter snouts; their tails are curly and they can appear to have less hair on their skin. They are also usually docile and apathetic towards humans.',
      sound_resref = '',
      vol_variance = 0,
      pitch_variance = 0,
      sound_length = 0.00,
   },
   [39369] = { -- 16816585
