      sound_resref = '',
      vol_variance = 0,
      pitch_variance = 0,
      sound_length = 0.00,
   },
   [39370] = { -- 16816586
      text = 'Planetars serve as the mighty generals of celestial armies. They also help powerful mortals on missions of good, especially if they involve battles with fiends.',
