      sound_length = 0.00,
   },
   [39372] = { -- 16816588
      text = 'Ringtails live in a variety of habitats within their range, but they have a decided preference for rocky areas such as rock piles, stone fences, canyon walls, and talus slopes. They occur less commonly in woodland areas where they live in hollow trees and logs, and they are also known to live in buildings.',
