      vol_variance = 0,
      pitch_variance = 0,
      sound_length = 0.00,
   },
   [39381] = { -- 16816597
      text = 'Sphinxes are enigmatic creatures with great, feathery wings and leonine bodies. Androsphinxes resemble winged lions with humanoid facial features. They are always male. Androsphinxes are clever and generally good-natured, but they can be savage opponents when provoked.',
