   },
   [39382] = { -- 16816598
      text = 'Sphinxes are enigmatic creatures with great, feathery wings and leonine bodies. Gynosphinxes are the female counterparts of androsphinxes. They have the bodies of winged lions with female humanoid facial features. They gladly bargain for treasure or service but constantly seek out challenges to their staggering intellects. Riddles, puzzles and other such things delight them to no end.',
