   [39451] = { -- 16816667
      text = 'Vecna, deity of secrets, was once a mortal king who became a lich. He usually appears as a lich who is missing his left hand and his left eye. He lost both in a fight with his traitorous lieutenant, Kas. Vecna rules that which is not meant to be known and that which people wish to keep secret.',
