      pitch_variance = 0,
      sound_length = 0.00,
   },
   [39452] = { -- 16816668
      text = 'Vegepygmies appear as 3-foot tall, bipedal creatures with sharp, thorny claws. Their shoulders, abdomens, and limbs are fringed with leaf-like and rooty tendrils. Their heads have a topknot of leaves.',
      sound_resref = '',
      vol_variance = 0,
      pitch_variance = 0,
      sound_length = 0.00,
   },
   [39453] = { -- 16816669
      text = 'Weasels have brown to yellow-brown fur with paler fur on the belly. The tip of the tail is often black. Many weasels grow white fur in the winter, but the tip of the tail remains black. When an animal chases the weasel, it will often chase the black tail tip and miss catching the weasel.',
      sound_resref = '',
      vol_variance = 0,
      pitch_variance = 0,
      sound_length = 0.00,
   },
   [39454] = { -- 16816670
      text = 'Wild boar are the ancestors of the domestic pig, and the two species can be interbred. Domestic pigs have larger ears and shorter snouts; their tails are curly and they can appear to have less hair on their skin. They are also usually docile, and apathetic towards humans. Hogs are much larger than pigs, and can weigh twice as much or even more.',
      sound_resref = '',
      vol_variance = 0,
      pitch_variance = 0,
      sound_length = 0.00,
   },
   [39455] = { -- 16816671
      text = 'With a giant, snakelike tail from the waist down and a female humanoid body above the waist many mistake mariliths for some sort of yuan-ti. But their six arms give them away, one of the most powerful of the Tanar ri.',
      sound_resref = '',
      vol_variance = 0,
      pitch_variance = 0,
      sound_length = 0.00,
   },
   [39456] = { -- 16816672
      text = 'Wolverines are omnivores (meat and plant eaters). They eat carrion (dead meat that they find), large and small mammals (like weak caribou, deer, and rodents), birds, eggs, fish, plants, roots, and fruit. They can kill animals that are bigger than they are. Wolverines sometimes kill more animals or meat than they can eat, so they store the remainder underground. Wolverines have powerful jaws that can crush bones.',
      sound_resref = '',
      vol_variance = 0,
      pitch_variance = 0,
      sound_length = 0.00,
