   [39501] = { -- 16816717
      text = 'Compared to other golems, which usually give an impression of bulk and power, gemstone golems\' brilliantly faceted forms appear agile and lithe. Looks can be deceiving. The heart of each gemstone golem is a carved stone of magnificent beauty. This fact does not comfort those who die beneath the golem\'s rock-hard fists.',
