      pitch_variance = 0,
      sound_length = 0.00,
   },
   [39503] = { -- 16816719
      text = 'Maugs are tireless soldiers in search of battle.  These constructs from Acheron are used on battlefieleds across the planes as perfect mercanaries, since they remain unflinchingly loyal to their employer and are fearless in battle.  Maugs serve any master willing to meet their price and they do not trouble themselves with questions of right or wrong.',
