      vol_variance = 0,
      pitch_variance = 0,
      sound_length = 0.00,
   },
   [39504] = { -- 16816720
      text = 'Osyluths, or Bone Devils, are different. They don\'t just want your soul, or want to kill you...they hate your very existence. Osyluth are the most terrible and savage of the devils for they hate with a passion all that is not like themselves. So when they aren\'t stringing up mortals into rugs and nifty wall hangings they serve their masters as spies and assassins.',
      sound_resref = '',
      vol_variance = 0,
      pitch_variance = 0,
